'use strict';

/**
* Month names (English).
*
* @module @stdlib/datasets/month-names-en
*
* @example
* var months = require( '@stdlib/datasets/month-names-en' );
*
* var list = months();
* // returns ['January','February','March','April','May','June','July','August','September','October','November','December']
*/

// MODULES //

var IS_BROWSER = require( '@stdlib/assert/is-browser' );


// MAIN //

var months;
if ( IS_BROWSER ) {
	months = require( './browser.js' );
} else {
	months = require( './month_names_en.js' );
}


// EXPORTS //

module.exports = months;
